struct Solution;
impl Solution {
    // 最后一个超时
    pub fn can_change_timeout(start: String, target: String) -> bool {
        let mut start = start.into_bytes();
        let mut target = target.into_bytes();

        for i in (0..start.len()).rev() {
            if start[i] == target[i] {
                continue;
            }

            match (start[i], target[i]) {
                (b'L', b'R') => return false,
                (b'R', b'L') => return false,
                (b'R', b'_') => return false,
                (b'_', b'L') => return false,
                (b'_', b'R') => match Self::last_r(&start, i) {
                    None => return false,
                    Some(id) => start.swap(i, id),
                },
                (b'L', b'_') => match Self::last_blank(&start, i) {
                    None => return false,
                    Some(id) => start.swap(i, id),
                },
                _ => {
                    panic!()
                }
            }
        }

        true
    }

    // 8ms 2.3mb
    pub fn can_change(start: String, target: String) -> bool {
        let mut start = start.into_bytes();
        let mut target = target.into_bytes();

        // 从右到左搜索第一个遇到的‘R'的位置，每次搜完后记录，下次从这个地方开始搜索
        let mut r_pos = start.len() - 1;
        let mut blank_pos = start.len() - 1;

        for i in (0..start.len()).rev() {
            if start[i] == target[i] {
                continue;
            }

            match (start[i], target[i]) {
                (b'L', b'R') => return false,
                (b'R', b'L') => return false,
                (b'R', b'_') => return false,
                (b'_', b'L') => return false,
                (b'_', b'R') => match Self::last_r(&start, i.min(r_pos)) {
                    None => return false,
                    Some(id) => {
                        start.swap(i, id);
                        r_pos = id;
                    }
                },
                (b'L', b'_') => match Self::last_blank(&start, i.min(blank_pos)) {
                    None => return false,
                    Some(id) => {
                        start.swap(i, id);
                        blank_pos = id;
                    }
                },
                _ => {
                    panic!()
                }
            }
        }

        true
    }

    // 从右到左，第一个遇到的R的位置，中间不能有L
    fn last_r(bytes: &Vec<u8>, start_id: usize) -> Option<usize> {
        for id in (0..start_id).rev() {
            if bytes[id] == b'R' {
                return Some(id);
            }
            if bytes[id] == b'L' {
                return None;
            }
        }
        return None;
    }

    // 从右到左，第一个遇到的 ‘_’ 的位置，中间不能有R
    fn last_blank(bytes: &Vec<u8>, start_id: usize) -> Option<usize> {
        for id in (0..start_id).rev() {
            if bytes[id] == b'_' {
                return Some(id);
            }
            if bytes[id] == b'R' {
                return None;
            }
        }
        return None;
    }
}

#[cfg(test)]
mod tests {
    use super::*;

    #[test]
    fn it_works() {
        assert_eq!(
            Solution::can_change("_L__R__R_".to_string(), "L______RR".to_string()),
            true
        );
        assert_eq!(
            Solution::can_change("R_L_".to_string(), "__LR".to_string()),
            false
        );
        assert_eq!(
            Solution::can_change("_R".to_string(), "R_".to_string()),
            false
        );

        assert_eq!(
            Solution::can_change("__LL".to_string(), "LL__".to_string()),
            true
        );
    }
}

